package edu.stanford.cs.jscontrols;

import edu.stanford.cs.controller.Controller;
import javax.swing.event.ChangeEvent;

public class StepControl extends JSControl {
   private boolean wasStepping;
   private static final String CONTROL = "data:image/png;base64,";
   private static final String PRESSED = "data:image/png;base64,";
   private static final String ROLLOVER = "data:image/png;base64,";
   private static final String DISABLED = "data:image/png;base64,";

   public StepControl() {
      this.setName("Step");
      this.setIcon(this.createImageIcon("data:image/png;base64,"));
      this.setDisabledIcon(this.createImageIcon("data:image/png;base64,"));
      this.setRolloverIcon(this.createImageIcon("data:image/png;base64,"));
      this.setPressedIcon(this.createImageIcon("data:image/png;base64,"));
   }

   public void stateChanged(ChangeEvent e) {
      switch(this.getController().getControllerState()) {
      case 1:
      case 3:
         this.setEnabled(false);
         this.wasStepping = false;
         break;
      case 2:
         this.wasStepping = true;
         break;
      case 4:
      default:
         this.setEnabled(true);
         break;
      case 5:
         this.setEnabled(!this.wasStepping);
         break;
      case 6:
         this.setEnabled(false);
      }

   }

   public void execute() {
      this.fireActionListeners();
      Controller controller = this.getController();
      if (controller != null) {
         controller.stepAction();
      }

   }
}
